    <div class="right-navbar">
        <button id="feedback" style="color: #FF2B72; text-decoration: underline;">Feedback</button>

<div class="container-content">
    <div id="top">
        <h1 class="Feedback">Feedback</h1>
        <h1 class="Excelent">Excelent</h1>
    </div>
    <div id="middle">
        <div class="left middle">
            <div class="slides">
                <input type="radio" name="r" id="radio1" checked>
                <input type="radio" name="r" id="radio2">
                <input type="radio" name="r" id="radio3">

                <div class="slide s1">
                    <div id="img">
                        <style>
                            svg#freepik_stories-feedback:not(.animated) .animable {
                                opacity: 0;
                            }

                            svg#freepik_stories-feedback.animated #freepik--background-simple--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight, 3s Infinite linear spin;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Plant--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn, 1.5s Infinite linear wind;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Picture--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Device--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideLeft, 3s Infinite linear heartbeat;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Character--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideUp, 1.5s Infinite linear floating;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Floor--inject-2 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
                                animation-delay: 0s;
                            }

                            @keyframes lightSpeedRight {
                                from {
                                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                                    opacity: 0;
                                }

                                60% {
                                    transform: skewX(10deg);
                                    opacity: 1;
                                }

                                80% {
                                    transform: skewX(-2deg);
                                }

                                to {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }

                            @keyframes spin {
                                from {
                                    transform: rotate(0);
                                }

                                to {
                                    transform: rotate(360deg);
                                }
                            }

                            @keyframes fadeIn {
                                0% {
                                    opacity: 0;
                                }

                                100% {
                                    opacity: 1;
                                }
                            }

                            @keyframes wind {
                                0% {
                                    transform: rotate(0deg);
                                }

                                25% {
                                    transform: rotate(1deg);
                                }

                                75% {
                                    transform: rotate(-1deg);
                                }
                            }

                            @keyframes slideLeft {
                                0% {
                                    opacity: 0;
                                    transform: translateX(-30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateX(0);
                                }
                            }

                            @keyframes heartbeat {
                                0% {
                                    transform: scale(1);
                                }

                                10% {
                                    transform: scale(1.1);
                                }

                                30% {
                                    transform: scale(1);
                                }

                                40% {
                                    transform: scale(1);
                                }

                                50% {
                                    transform: scale(1.1);
                                }

                                60% {
                                    transform: scale(1);
                                }

                                100% {
                                    transform: scale(1);
                                }
                            }

                            @keyframes slideUp {
                                0% {
                                    opacity: 0;
                                    transform: translateY(30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: inherit;
                                }
                            }

                            @keyframes floating {
                                0% {
                                    opacity: 1;
                                    transform: translateY(0px);
                                }

                                50% {
                                    transform: translateY(-10px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateY(0px);
                                }
                            }

                            @keyframes slideRight {
                                0% {
                                    opacity: 0;
                                    transform: translateX(30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateX(0);
                                }
                            }
                        </style>

                            svg#freepik_stories-feedback:not(.animated) .animable {

                            svg#freepik_stories-feedback.animated #freepik--background-complete--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) fadeIn, 1.5s Infinite linear wind;
                                animation-delay: 0s, 1.5s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Floor--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) slideRight;
                                animation-delay: 0s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--Stars--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedLeft, 3s Infinite linear heartbeat;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--speech-bubble-2--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) zoomIn, 1.5s Infinite linear heartbeat;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--speech-bubble-1--inject-6 {
                                animation: 1s 1 forwards ease-out slideLeft, 3s Infinite linear heartbeat;
                                animation-delay: 0s, 1.5s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--character-2--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight, 1.5s Infinite linear floating;
                                animation-delay: 0s, 1s;
                            }

                            svg#freepik_stories-feedback.animated #freepik--character-1--inject-6 {
                                animation: 1s 1 forwards cubic-bezier(.36, -0.01, .5, 1.38) lightSpeedRight, 1.5s Infinite linear floating;
                                animation-delay: 0s, 2s;
                            }

                            @keyframes fadeIn {
                                0% {
                                    opacity: 0;
                                }

                                100% {
                                    opacity: 1;
                                }
                            }

                            @keyframes wind {
                                0% {
                                    transform: rotate(0deg);
                                }

                                25% {
                                    transform: rotate(1deg);
                                }

                                75% {
                                    transform: rotate(-1deg);
                                }
                            }

                            @keyframes slideRight {
                                0% {
                                    opacity: 0;
                                    transform: translateX(30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateX(0);
                                }
                            }

                            @keyframes lightSpeedLeft {
                                from {
                                    transform: translate3d(-50%, 0, 0) skewX(20deg);
                                    opacity: 0;
                                }

                                60% {
                                    transform: skewX(-10deg);
                                    opacity: 1;
                                }

                                80% {
                                    transform: skewX(2deg);
                                }

                                to {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }

                            @keyframes heartbeat {
                                0% {
                                    transform: scale(1);
                                }

                                10% {
                                    transform: scale(1.1);
                                }

                                30% {
                                    transform: scale(1);
                                }

                                40% {
                                    transform: scale(1);
                                }

                                50% {
                                    transform: scale(1.1);
                                }

                                60% {
                                    transform: scale(1);
                                }

                                100% {
                                    transform: scale(1);
                                }
                            }

                            @keyframes zoomIn {
                                0% {
                                    opacity: 0;
                                    transform: scale(0.5);
                                }

                                100% {
                                    opacity: 1;
                                    transform: scale(1);
                                }
                            }

                            @keyframes slideLeft {
                                0% {
                                    opacity: 0;
                                    transform: translateX(-30px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateX(0);
                                }
                            }

                            @keyframes lightSpeedRight {
                                from {
                                    transform: translate3d(50%, 0, 0) skewX(-20deg);
                                    opacity: 0;
                                }

                                60% {
                                    transform: skewX(10deg);
                                    opacity: 1;
                                }

                                80% {
                                    transform: skewX(-2deg);
                                }

                                to {
                                    opacity: 1;
                                    transform: translate3d(0, 0, 0);
                                }
                            }

                            @keyframes floating {
                                0% {
                                    opacity: 1;
                                    transform: translateY(0px);
                                }

                                50% {
                                    transform: translateY(-10px);
                                }

                                100% {
                                    opacity: 1;
                                    transform: translateY(0px);
                                }
                            }
